import React from 'react';
import './MenuItem.styles.scss'

const MenuItem = ({ section }) => {
    return (
        <div className='menu-item'>
            <div className='content'>
                <h1 className='title'>{section.title}</h1>
                <span className='subtitle'>
                        Shop Now
                    </span>
            </div>
        </div>
    )
}

export default MenuItem
